// Home.js
import React, { useEffect } from 'react';
import Hero from './Hero';
import WhatsInside from './WhatsInside';
import HowItWorks from './HowItWorks';

function Home() {
  useEffect(() => {
    document.title = 'LootBox - Home'; // Set page title
  }, []);

  return (
    <div>
      <Hero />
      <WhatsInside />
      <HowItWorks />
    </div>
  );
}

export default Home;
